import './App.css';
import React, { useState,useEffect } from 'react';
import Navbar from './components/Navbar'
import Container from './components/Container'
import Footer from './components/Footer'
import Carousel from './components/Carouselitems'
import Proptypes from "prop-types"
import Login from './components/Login.js';
import signup from './components/Signup.js';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  BrowserRouter
}from"react-router-dom";

function App() {
const prevent=(event)=>{
  event.preventDefault();
}
  return (
<>
<BrowserRouter>
<Navbar prevent={prevent}></Navbar>
<div>
<Routes>
  <Route exact path='/'    element={<Container key="/"></Container>}>
  </Route>
  <Route exact path='/home'  element={<Container key="home"></Container>}>
  </Route>
  <Route exact path='/jewelery'   element={<Container key="jewelery" category="jewelery"></Container>}>
  </Route>
  <Route exact path='/electronics'  element={<Container  key="electronics" category="electronics"></Container>}>
  </Route>
  <Route exact path='men clothing'  element={<Container  key="men clothing" category="men's clothing"></Container>}>
  </Route>
  <Route exact path='/women clothing'  element={<Container key="women clothing"  category="women's clothing"></Container>}>
  </Route>
  <Route exact path='/login' element={<Login key="looog in"></Login>}></Route>
  <Route exact path='/signup' element={<Signup key="sig"></Signup>}></Route>

</Routes>

</div>
</BrowserRouter>
</>
  );
}

export default App;
